import React, { Component } from 'react'
import WrapComponents from '@/components/wrapper'

class Segementation extends Component {
    state = {
        createSegment: false,
    }
    render() {
        const { allUser } = this.state
        return (
            <WrapComponents>
                <div className="section">
                    <Radio>All User</Radio>
                    <Radio>Create Segment</Radio>
                </div>
            </WrapComponents>
        )
    }
}

export default Segementation
